import React from 'react'
import { View  , TouchableOpacity,StyleSheet,Text
} from 'react-native'


const CustomButton =() =>
{
    return(
        <TouchableOpacity style={styles1.container} >
        
                 <Text>dd</Text>
        
        </TouchableOpacity>
        
    )
};

export default CustomButton;

const styles1 = StyleSheet.create({
    container :{ 
    
        alignItems:'center',

        backgroundColor:'#0077b6',
        width:'30%',
       
    }


})
